      nextcloud:
        paths:
        - data: 
          path: /core/img/favicon-touch.png
        - data: 
          path: /core/img/favicon.ico
        subdomain: files
      notes:
        paths:
        - data: 
          path: /favicon.ico
        subdomain: notes
      openproject:
        paths:
